import React from 'react';
import ReactDOM from 'react-dom/client';
import AddCourseForm from './components/AddCourseForm';

const App = () => {
  return (
    <div className="App">
      <AddCourseForm />
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
